/*Table structure for table `qjs_app_feedback` */

DROP TABLE IF EXISTS `qjs_app_feedback`;

CREATE TABLE `qjs_app_feedback` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `content` varchar(500) NOT NULL DEFAULT '' COMMENT '反馈内容',
  `contact` varchar(200) NOT NULL DEFAULT '' COMMENT '联系方式',
  `token` varchar(200) NOT NULL DEFAULT '' COMMENT '用户token',
  `mobile_id` varchar(200) NOT NULL DEFAULT '' COMMENT '手机ID',
  `version` varchar(200) NOT NULL DEFAULT '' COMMENT '版本号',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态>1|有效,0|无效,99|删除',
  `create_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `last_modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后更新时间',
  PRIMARY KEY (`id`),
  KEY `mobile_id` (`mobile_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1017 DEFAULT CHARSET=utf8 COMMENT='APP意见反馈表';

