/*Table structure for table `qjs_app_upgrade` */

DROP TABLE IF EXISTS `qjs_app_upgrade`;

CREATE TABLE `qjs_app_upgrade` (
  `upgrade_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '版本升级ID',
  `version_main` int(11) NOT NULL DEFAULT '1' COMMENT '主版本号',
  `version_middle` int(11) NOT NULL DEFAULT '0' COMMENT '次版本号',
  `version_min` int(11) NOT NULL DEFAULT '0' COMMENT '小版本号',
  `version_no` char(10) NOT NULL DEFAULT '' COMMENT '版本号',
  `upgrade_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否强制升级>0|普通升级,1|强制升级',
  `upgrade_text` text NOT NULL COMMENT '升级描述',
  `upgrade_url` varchar(1024) NOT NULL DEFAULT '' COMMENT '升级地址',
  `client_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '客户端类型>0|未知类型,1|iOS,2|Android',
  `publish_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '发布时间',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态>0|无效,1|待发布,2|已发布,9|已下线',
  `create_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `last_modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`upgrade_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='App升级版本表';

